(219, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:80:\"How Ongage Optimized Their Elementor-Based Website and Boosted Its Speed by 110%\";s:7:\"excerpt\";s:221:\"\"We wanted to make a pixel-perfect website that perfectly conveyed our brand\" — learn how Ongage, a full-stack email marketing platform, used Elementor to redesign their website and improve its performance dramatically.\";s:7:\"created\";i:1644321663;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:116:\"https://elementor.com/blog/ongage-casestudy/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:59:\"Expert Web Creators of the Month: One Form to Rule Them All\";s:7:\"excerpt\";s:156:\" We challenged you to create snazzy contact forms, enticing newsletter signups, and delightful multi-step experiences —  see which web creators stood out.\";s:7:\"created\";i:1644219143;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:138:\"https://elementor.com/blog/expert-web-creators-of-the-month-forms/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:55:\"Capture Hearts and Sales With Our Valentine’s Day Kit\";s:7:\"excerpt\";s:185:\"Our new Valentine\'s Day Kit is full of wonderful landing pages, sections, popups, and vector assets to help you quickly get your website ready for the most romantic holiday of the year.\";s:7:\"created\";i:1642422001;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:118:\"https://elementor.com/blog/valentines-day-kit/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:55:\"How To Create a Content Marketing Strategy From Scratch\";s:7:\"excerpt\";s:208:\"A clear content strategy is crucial to stand out and drive business results in an increasingly saturated marketplace. In this guide, we\'ll walk you through the steps of creating a successful content strategy.\";s:7:\"created\";i:1642091419;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:126:\"https://elementor.com/blog/content-marketing-strategy/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:66:\"A Look at Your Favorite Elementor Features and Offerings From 2021\";s:7:\"excerpt\";s:250:\"Back in November, we asked you which of the features or offerings released in 2021 were your favorite. As we reviewed the results we also took the time to reflect on what we’ve done in the past year to see how far we’ve come, let’s take a look.\";s:7:\"created\";i:1641715922;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:132:\"https://elementor.com/blog/your-top-features-offerings-2021/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
