(226, '_transient_auxin_cache_remote_changelog__phlox', '<h4 class=\"aux-changelog-item-title\"><span class=\"aux-changelog-item-version\">Version <strong>2.9.3</strong></span><span class=\"aux-changelog-item-date\">(18.01.2022)</span></h4><ul>[Fix]: An issue with duplicated results while searching in products fixed.\r</li>[Fix]: An error while using Polylang and saved templates for Post Widgets fixed.\r</li>[Improvement]: Improvement for the functionality of shopping cart applied.\r</li>[Improvement]: Now counter element supports float numbers as well. </li></ul><h4 class=\"aux-changelog-item-title\"><span class=\"aux-changelog-item-version\">Version <strong>2.9.2</strong></span><span class=\"aux-changelog-item-date\">(27.12.2021)</span></h4><ul><li><span class=\"aux-changelog-item-type aux-changelog-type-fix\">Fix</span> A render issue with outlined icons for like button fixed. \r</li><li><span class=\"aux-changelog-item-type aux-changelog-type-fix\">Fix</span>  An issue with submenu indicator style on mobile screen size fixed.\r</li><li><span class=\"aux-changelog-item-type aux-changelog-type-improvement\">Improve</span> Improvement for responsive style of cart page applied.\r</li><li><span class=\"aux-changelog-item-type aux-changelog-type-new\">New</span> New sidebar widget area for shop pages added.\r</li><li><span class=\"aux-changelog-item-type aux-changelog-type-improvement\">Improve</span> Style improvement for add to cart notification in responsive view applied.</li></ul><h4 class=\"aux-changelog-item-title\"><span class=\"aux-changelog-item-version\">Version <strong>2.9.1</strong></span><span class=\"aux-changelog-item-date\">(30.11.2021)</span></h4><ul><li><span class=\"aux-changelog-item-type aux-changelog-type-improvement\">Improve</span> Improvements for the style of product swatches applied.\r</li><li><span class=\"aux-changelog-item-type aux-changelog-type-improvement\">Improve</span> SVG filter tags added to allowed tags.\r</li><li><span class=\"aux-changelog-item-type aux-changelog-type-fix\">Fix</span> Fixing a style issue in the product quick-look window.\r</li><li><span class=\"aux-changelog-item-type aux-changelog-type-fix\">Fix</span> Fixing an issue with not showing the date for the popular posts widget.</li></ul><h4 class=\"aux-changelog-item-title\"><span class=\"aux-changelog-item-version\">Version <strong>2.9.0</strong></span><span class=\"aux-changelog-item-date\">(22.11.2021)</span></h4><ul><li><span class=\"aux-changelog-item-type aux-changelog-type-improvement\">Improve</span> Compatibility with the new version of \"Variation Swatches for WooCommerce\" plugin applied.\r</li><li><span class=\"aux-changelog-item-type aux-changelog-type-improvement\">Improve</span> Improvements for responsiveness of cart page applied.</li></ul><h4 class=\"aux-changelog-item-title\"><span class=\"aux-changelog-item-version\">Version <strong>2.8.9</strong></span><span class=\"aux-changelog-item-date\">(19.09.2021)</span></h4><ul><li><span class=\"aux-changelog-item-type aux-changelog-type-improvement\">Improve</span> Javascript libraries updated to the latest version and deprecated jQuery functions are fixed.\r</li><li><span class=\"aux-changelog-item-type aux-changelog-type-improvement\">Improve</span> Compatibility with the latest version of Elementor applied. \r</li><li><span class=\"aux-changelog-item-type aux-changelog-type-fix\">Fix</span> A typo in a Customizer option fixed. \r</li></li></ul>', 'no');

